import logo from "./logo.svg";
import "./App.css";
import BotonForm from "./components/BotonForm";
import Formulario from "./components/Formulario";

function App() {
  return (
    <>
      <div className="row mt-5">
        <Formulario nombre="Nombre" />

        <BotonForm />
      </div>
    </>
  );
}

export default App;
